import React from 'react';
import {NavLink} from 'react-router-dom';
import Logo from "../../Logo_recipe_keeper.svg";
import "./Navbar.css";

const Navbar = () => {
    return (
        <header className="header">
        <NavLink to="/"><img src={Logo} alt="logo: a frying pan with a recipe written in a little paper inside"></img></NavLink>
        <nav>
            <ul className="navlinks"> 
                <li id="create_recipe"><NavLink to="/create">New Recipe</NavLink></li>
            </ul>
        </nav>
        </header>
    )
}
export default Navbar;
